import React from 'react';
import {NavLink} from "react-router-dom";
import './header.css';

const Header = () => {
  return (
    <div class = "header">
      <div class = "title">
      <NavLink style={{color: 'white', textDecoration: 'none'}}  to='/'>Auction Center</NavLink>Marketplace Website (M)
      </div>
      <div class = "elements">
        <NavLink style={{color: 'white', textDecoration: 'none'}}  to='/page1'>Auction Center</NavLink>
        <NavLink style={{color: 'white', textDecoration: 'none'}}  to='/page1'>Collection</NavLink>
        <NavLink style={{color: 'white', textDecoration: 'none'}}  to='/page1'>About Us</NavLink>
        <NavLink style={{color: 'white', textDecoration: 'none'}}  to='/page1'>Login</NavLink>
        <NavLink style={{color: 'white', textDecoration: 'none'}} to='/page2'>Sign Up</NavLink>
      </div>
    </div>
  )
}

export default Header;
